    /**
     * Extracts lower-case ASCII root domain from URL if it is available and valid, returns false otherwise.
     *
     * @param string $url
     *
     * @return false|string
     */
    public static function getRootDomain($url)
    {
        $host = $domain = self::getHostname($url);
        $root = false;

        if (($dotsCount = substr_count($host, '.')) > 0) {
            $last = $domain;
            while ($dotsCount > -1) {
                if (self::isHostInSuffixList($domain)) {
                    $root = $last;
                    break;
                }
                $last = trim($domain, '.');
                $domain = substr($last, strpos($last, '.'));
                $dotsCount = $dotsCount - 1;
            }
        }

        return $root;
    }

    /**
     * @param string $url
     *
     * @return string|false
     */
    public static function getHostname($url)
    {
        if (!isset(self::$cache[$url]['hostname'])) {
            self::$cache[$url]['hostname'] = self::parseUrl($url, PHP_URL_HOST);
        }

        return self::$cache[$url]['hostname'];
    }

    /**
     * @param string $url
     *
     * @return string
     */
    public static function getPath($url)
    {
        if (!isset(self::$cache[$url]['path'])) {
            self::$cache[$url]['path'] = self::parseUrl($url, PHP_URL_PATH);
        }

        return self::$cache[$url]['path'];
    }

    /**
     * Checks an URL for validity, and punycode encode the returned component.
     *
     * @param string $url
     * @param int    $component
     *
     * @return string|false
     */
    private static function parseUrl($url, $component)
    {
        if (!isset(self::$cache[$url]['url'])) {
            // Strip protocol
            $scheme = parse_url($url, PHP_URL_SCHEME);
            $url = str_replace($scheme.'://', '', $url);
            $url = str_replace($scheme.':', '', $url);

            // Punycode encode domain
            $host = parse_url('http://'.$url, PHP_URL_HOST);
            $punycode = new Punycode();
            $url = str_replace($host, $punycode->encode($host), $url);

            // Add back normalized protocol
            $url = 'http://'.$url;

            // Remove all illegal characters from a url
            $url = filter_var($url, FILTER_SANITIZE_URL);

            // Sanity check
            if (($check = filter_var($url, FILTER_VALIDATE_URL)) === false) {
                $url = false;
            }

            self::$cache[$url]['url'] = $url;
        }

        return parse_url(strtolower(self::$cache[$url]['url']), $component);
    }

    /**
     * @param false|string $host
     *
     * @return bool
     */
    private static function isHostInSuffixList($host)
    {
        return (bool) substr_count(self::$suffixList, $host);
    }
